def count_xmas_patterns(grid):
    rows, cols = len(grid), len(grid[0])
    count = 0

    def check_mas(diagonal):
        return diagonal == "MAS" or diagonal == "SAM"

    for r in range(1, rows - 1):
        for c in range(1, cols - 1):
            upper_left = grid[r - 1][c - 1] + grid[r][c] + grid[r + 1][c + 1]
            upper_right = grid[r - 1][c + 1] + grid[r][c] + grid[r + 1][c - 1]
            if check_mas(upper_left) and check_mas(upper_right):
                count += 1

    return count


